import Head from 'next/head'
import styles from '../styles/Home.module.css'
import ScriptTag from 'react-script-tag'
import dynamic from 'next/dynamic'
import Topnav from '../components/layout/topnav'
import Main from '../components/main'

const Circles = dynamic(
  () => import('../components/visuals/circles'),
  {
    ssr: false
  }
)

function Home() {

  return (
    <div>
      <Topnav currentPage='Home'></Topnav>
      <section style={{textAlign: "center"}}>
        <Circles position='fixed' HD='true' />
        <div style={{position: 'absolute', textAlign: 'center', top: '0px', bottom: '0px'}}>
          <h1>Hi, I'm Caleb</h1>
          <h2>Welcome to my dojo</h2>
        </div>
      </section>
    </div>
  )
}

export default Home;
